webpackJsonp([48502967937490],{3423:function(t,n){t.exports={data:{markdownRemark:{html:"<p><strong>🌡8℃ ☀</strong></p>\n<p>昨日は午後は買い出しに付き合い、その途中で U 君と会い、そのまま遊びに行きました。</p>\n<p>そして今日、父親に連れられ、毛呂山町の福祉会館に行きました。\n今日はここの大ホールで幼稚園児のコンサート会があるそうです。</p>\n<p>十分程席で待っているとやっとコンサート会が始まりました。\nステージには可愛らしい園児たちがコンサートを演じて、とても楽しかったです。</p>",frontmatter:{cover:null,date:"1991-01-20T21:30:00+09:00",strDate:"1991/1/20",title:"日記"}}},pathContext:{path:"/ja/blog/1991/01/20-diary/",langKey:"ja"}}}});
